import React from "react";
import Label from "./Label";
import Input from "./Input";

const Form = ({ look, types }) => {
  return (
    <form className={look}>
      {types.map((type) => (
        <div>
          <Label type={type} />
          <div class="mt-2">
            <Input type={type} />
          </div>
        </div>
      ))}
      <div>
        <Label type="Email" />
        <div class="mt-2">
          <Input type="Email" />
        </div>
      </div>
      <div className=" ">
        <Label type="Password" />
        <div class="mt-2">
          <Input type="Password" />
        </div>
      </div>
    </form>
  );
};

export default Form;
